import React from 'react';
import { IonContent, IonPage, IonTitle, IonToolbar, IonButton, IonIcon, IonFooter, IonProgressBar } from '@ionic/react';
import { settingsOutline, personCircleOutline} from 'ionicons/icons';
// import { 
//   playSkipBackSharp,
//   playSkipForwardSharp,
// } from 'ionicons/icons';
import './Home.css';
import '../compoments/chevron.svg'
import ProgressBar from '../components/ProgressBar'
import MainWord from '../components/MainWord'
import Words from '../components/Words'

// import './AA.js';

const Home: React.FC = () => {
  // console.log(AA);
  return (
    <IonPage>
      <IonContent
        scrollEvents={false}
        onIonScrollStart={() => {}}
        onIonScroll={() => {}}
        onIonScrollEnd={() => {}}>
          <IonToolbar className="toolbar">
            <IonButton routerLink="/profile" fill="clear" size="large" color="light">    
              <IonIcon icon={personCircleOutline} />      
            </IonButton>
            <IonButton className="right" routerLink="/settings" fill="clear" size="large" color="light">    
              <IonIcon icon={settingsOutline} />
            </IonButton>
          </IonToolbar>
          <div className="chevron-button" onClick={() => console.log("click left")}>
            <IonIcon className="right chevron" src='data:image/svg+xml;utf8,<svg width="67" height="102" viewBox="0 0 67 102" fill="none" xmlns="http://www.w3.org/2000/svg">
            <rect x="50.9497" y="101.606" width="72.0537" height="22.6986" transform="rotate(-135 50.9497 101.606)" fill="white"/>
            <rect x="66.7626" y="16.0503" width="70.4294" height="22.6986" transform="rotate(135 66.7626 16.0503)" fill="white"/>
            </svg>' />
          </div>
          <div className="chevron-button right" onClick={() => console.log("click right")}>
            <IonIcon className="chevron" src='data:image/svg+xml;utf8,<svg width="67" height="102" viewBox="0 0 67 102" fill="none" xmlns="http://www.w3.org/2000/svg">
              <rect x="16.0503" width="72.0537" height="22.6986" transform="rotate(45 16.0503 0)" fill="white"/>
              <rect x="0.237427" y="85.5559" width="70.4294" height="22.6986" transform="rotate(-45 0.237427 85.5559)" fill="white"/>
              </svg>' />
          </div>
          {/* <div className="rhymes">
              <p>Yappy</p>
              <p>Rap beef</p>
              <p>Attack me</p>
              <p className="main">Exactly</p>
              <p>Versace</p>
              <p>Vigilante</p>
              <p>Unhappy</p>
              <p>Hacking </p>
          </div> */ }
          <div className="remaining">{ "20" } bars remaining</div>
          {/* <ProgressBar onComplete={() => console.log("Complete!")}></ProgressBar>
          <MainWord word={"first"} opacity={1}></MainWord>
          <MainWord word={"second"} opacity={1}></MainWord> */}
          <Words words={["one", "two"]} index={1}></Words>
          <IonProgressBar className="song-bar" value={0.72}></IonProgressBar>
      </IonContent>
      <IonFooter className="ion-no-border footer">
        <IonToolbar>
          <IonTitle>Footer - No Border</IonTitle>
        </IonToolbar>
    </IonFooter>
    </IonPage>
  );
};

export default Home;
